import React, { useEffect, useState } from 'react';

export default function Rating(props) {
  const { rating, numReviews } = props;
  const [star, setStar] = useState([]);

  useEffect(() => {
    const showRating = () => {
      let nStar = parseInt(rating);
      console.log(nStar);
      for (let i = 0; i < nStar; i++) {
        setStar(star.push(i));
      }
    };

    showRating();
  }, []);
  return (
    <div>
      {star.map((res) => (
        <p>{res}</p>
      ))}
    </div>
  );
}
